import React, { useRef, useEffect, useState } from 'react';
import env from 'react-dotenv'
import md5 from 'md5'

const Characters = () => {
   // const apiPublic = env.PUBLIC_KEY 
   // const apiPrivate = env.PRIVATE_KEY
   const apiPublic = `8b49042fc572b4e9a0840fbdf13027af`
   const apiPrivate = `84677788f58c4b22ecfdc7241674df92a3b8a513`;
   const date = new Date()
   const timeStamp = date.getTime()
   console.log(timeStamp)
   const hashString = timeStamp + apiPrivate + apiPublic
   let hash = md5(hashString)
   const searchname = "Thor"

   const apiUrl = `https://gateway.marvel.com/v1/public/characters?nameStartsWith=${searchname}&ts=${timeStamp}&apikey=${apiPublic}&hash=${hash}`;
   console.log(apiUrl)
   console.log("this is hash", hash)

   const [characters, setCharacters] = useState(null)

   const getCharacters = useRef(() => {});
      getCharacters.current = async () => {
         const response = await fetch(apiUrl)
         const data = await response.json()
         setCharacters(data)
         console.log(characters)
      }

   useEffect(() => {
      getCharacters.current()
   }, [])

   const loaded = () => {
      return (
         characters.data.results.map((character, index) => {
            return (
               <div className="container">
                  <h1 className="title">Characters</h1>
               </div>
            )
         })
      )
   }

} 

export default Characters
